## 获取 url 中的参数

```js
// 方法1
function query(url) {
    return url.match(/([^?=&]+)(=([^&]*))/g).reduce((obj, v) => {
        const tmp = v.split('=')
        obj[tmp[0]] = tmp[1]
        return obj
    }, {})
}
// 方法2
function params2json(url) {
    return new URL(url).searchParams
}
// 方法3
function params2json(url) {
    return new URLSearchParams(url)
}
// 方法2和方法3的使用
const uri = 'http://baidu.com?ie=10&b=c'
params2json(uri).get('ie') // 10
```

